import React from "react";
import SearchPresenter from "./SearchPresenter";

export default class extends React.Component {
  state = { movieResult: null, tvResult: null, loading: null, error: null };

  render() {
    const { movieResult, tvResult, loading, error } = this.state;
    return (
      <SearchPresenter
        movieResult={movieResult}
        tvResult={tvResult}
        loading={loading}
        error={error}
      />
    );
  }
}
